function pageLoad(){$(".bs-pagination td table").each(function(n,t){convertToPagination(t)})}function convertToPagination(n){var t='<ul class="pagination">',i;$(n).find("tbody tr").each(function(){$(this).children().map(function(){t=t+"<li>"+$(this).html()+"<\/li>"})});t=t+"<\/ul>";i=$(t);i.find("span").parent().addClass("active");$(n).replaceWith(i)}